import image_navbar from '../../assents/images/image.svg';
import { Titulo } from './Style.css';

export default function Navbar() {
    return (
        <div>
            <img src={image_navbar}/>
            <div>
                <Titulo>
                    <h1>
                        Star Wars movies
                    </h1>
                </Titulo>
                <form>
                    <input />
                </form>
            </div>
        </div>

    );
};
